    eqcon[10] *= 1e+06; 

    /*reaction 12: H2 + M <=> H + H + M */
    eqcon[11] *= 1e-06; 

    /*reaction 13: O + O + M <=> O2 + M */
    eqcon[12] *= 1e+06; 

