    kc[163] = refC * exp((g_RT[33]) - (g_RT[27] + g_RT[11]));

    /*reaction 165: HOCH2OCO <=> CH2OH + CO2 */
    kc[164] = refC * exp((g_RT[33]) - (g_RT[17] + g_RT[22]));

    /*reaction 166: HOCH2O <=> HCOOH + H */
    kc[165] = refC * exp((g_RT[27]) - (g_RT[25] + g_RT[0]));

    /*reaction 167: CH2O + OH <=> HOCH2O */
    kc[166] = 1.0 / (refC) * exp((g_RT[15] + g_RT[7]) - (g_RT[27]));

    /*reaction 168: HCOOH <=> HCO + OH */
    kc[167] = refC * exp((g_RT[25]) - (g_RT[13] + g_RT[7]));

    /*reaction 169: HCOOH + OH <=> H2O + CO2 + H */
    kc[168] = refC * exp((g_RT[25] + g_RT[7]) - (g_RT[8] + g_RT[22] + g_RT[0]));

    /*reaction 170: HCOOH + OH <=> H2O + CO + OH */
    kc[169] = refC * exp((g_RT[25] + g_RT[7]) - (g_RT[8] + g_RT[11] + g_RT[7]));

    /*reaction 171: HCOOH + H <=> H2 + CO2 + H */
    kc[170] = refC * exp((g_RT[25] + g_RT[0]) - (g_RT[1] + g_RT[22] + g_RT[0]));

    /*reaction 172: HCOOH + H <=> H2 + CO + OH */
    kc[171] = refC * exp((g_RT[25] + g_RT[0]) - (g_RT[1] + g_RT[11] + g_RT[7]));

