    kc[172] = refC * exp((g_RT[25] + g_RT[4]) - (g_RT[6] + g_RT[11] + g_RT[7]));

    /*reaction 174: HCOOH + HO2 <=> H2O2 + CO + OH */
    kc[173] = refC * exp((g_RT[25] + g_RT[20]) - (g_RT[21] + g_RT[11] + g_RT[7]));

    /*reaction 175: HCOOH + O <=> CO + OH + OH */
    kc[174] = refC * exp((g_RT[25] + g_RT[5]) - (g_RT[11] + g_RT[7] + g_RT[7]));

